import React from 'react';
import Container from 'react-bootstrap/Container';

class BlogPost extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            title: '',
            content: '',
            date: ''
        }
    }

    render() {
        return (
            <Container fluid={false}>
                <h4>Test</h4>
                <p>Test</p>
            </Container>
        );
    }

}

export default BlogPost;
